import React from 'react';
import '../App.css';
import {sortableElement} from 'react-sortable-hoc';


const SortableItem = sortableElement(
  ({value}) => (
    <li>
      {value.cue + " "}{value.action}
    </li>
  )
);


// <div className="habit">
