//       <div className="cue">{props.cue}</div>
//       <div className="action">{props.action}</div>
//   </div>
// </div>

function Habit(props){
  return (
    <SortableItem
      value={props.value}
      index={props.index}
      collection={props.collection}
    />
  )
}


export default Habit;
